import React from "react";
import Button from "@material-ui/core/Button";

function Login() {
  return (
    <div className="login_body">
      <form action="">
        <label>User Name</label>
        <input />

        <label>Password</label>
        <input />
      </form>

      <div>
        <Button variant="contained" color="primary">
          Login
        </Button>
      </div>
    </div>
  );
}

export default Login;
